import React from 'react';
import { NavLink } from 'react-router-dom';
import styled from "styled-components";
import hk from './hk.jpg';

export const App = () => {
  return (
    <Background>
              <Container>

        <Navigation>
          <MenuLink href="#home">
            <h3>Home</h3>
          </MenuLink>
          <MenuLink href="#about">          
            <h3>About</h3>
          </MenuLink>        
          <MenuLink href="#services">
            <h3>Services</h3>
          </MenuLink>
          <MenuLink href="#portfolio"> 
            <h3>Portfolio</h3>
          </MenuLink>          
          <MenuLink href="#contact">
            <h3>Contact</h3>
          </MenuLink>
        </Navigation>

<FrontPage id="home">
<h1>Soliman Doe
DESIGNER DEVELOPER FREELANCER
    </h1>
</FrontPage>
<About id="about">
<h1> Hi there, I'm Soliman Doe</h1>
</About>
<Services id="services">
<h1>This is what I do</h1>
<ServiceSection>

<ServiceCard>
  <h2>First example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Second example</h2>
</ServiceCard>
<ServiceCard>
  <h2>Third example</h2>
</ServiceCard>

</ServiceSection>

</Services>
<Portfolio id="portfolio">
<h1>This is what I've done</h1>

</Portfolio>
<Contact id="contact">
<h1>How to contact me</h1>
</Contact>
      </Container>
    </Background>
  )
}


const Background = styled.main`
background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${hk});
background-position: center;
background-repeat: no-repeat;
background-size: cover;
background-attachment: fixed;
height: 100%; 
width: 100%; 
`

const Container = styled.div`
`
const Navigation = styled.div`
background-color: rgba(0, 0, 0, 0.6);
display: flex; 
justify-content: flex-end; 
position: fixed;
top: 0; 
width: 100%; 
`
const MenuLink = styled.a`
padding-right: 10px; 
`


